import { useEffect } from 'react';

useEffect( () => {

    async function fetchApi(){

      const data = await fetch('/api/user');
      const text = await data.text();

    }

    fetchApi()
  } 
  )

  import React from 'react'

  function Hello() {
      return (
          <div>
              {text}
          </div>
      )
  }

  export default Hello
